import React from "react";
import styled from "styled-components";
import bg from "../../../images/background.jpeg";

const MainStyle = styled.div`
    width: 100%;
    height: 100%;
    background-image: url(${bg});
`;

const Main = () => {
    return (
        <MainStyle>
            <div></div>
        </MainStyle>
    );
};

export default Main;
